import "./../App.css"
import React from "react";
import { useNavigate} from "react-router-dom";

function RegisterPage(){
    let navigate = useNavigate();
    return(
        <div className="login-page">
            <div className="login-form">
                <h1 className="login-header">SIGN IN</h1>
                <form >
                    <input className="input-field" placeholder='Email or Phone' type='text' /><br/><br/>
                    <input className="input-field" placeholder='Name' type='text' /><br/><br/>
                    <input className="input-field" type='text' placeholder='Password' /><br/><br/>
                    <button className="login-button" type="submit" >Sign In</button>
                </form>
                <hr />
                <div className="create-account">
                    <a href="#" onClick={ () => { navigate('/')}}>Create New Account</a>
                </div>
            </div>


        </div>
    );
};
export default RegisterPage;
